import React from 'react'
import Profile from './Profile'

const EventPage = () => {
  return (
    <div>
      <Profile children={
        <button style ={{width: "80px"}}
        onClick={() => navigate ("/events/new")}>Add Event</button>
      }/>
      <div className='eventPage'>
        
      </div>
    </div>
  )
}

export default EventPage
